import {Dropdown} from "react-bootstrap";
import './styles/customDropdown.css';


const CustomToggle = React.forwardRef(({ children, onClick }, ref) => (
    <a
        href=""
        ref={ref}
        onClick={(e) => {
            e.preventDefault();
            onClick(e);
        }}
        className='tx-gray'
    >
        {children}
        &#x25bc;
    </a>
));
